/* eslint-disable prettier/prettier */
import styled from 'styled-components'
import Nav from './Nav';
import Search from './Search';
import Login from './Login';

const Header = () => (
        <Wrapper>
            <NavWrapper>
            <Nav />
            </NavWrapper>
                <Search />
                <Login />
        </Wrapper>


    )
const Wrapper = styled.header`
display:flex;
align-items:center;

width:100%;
`
const NavWrapper= styled.div`
margin-right:auto;
`
export default Header;
